import React, { Component } from 'react';
import Slider from "react-slick";


class HeroCarousel extends Component {

    render() {
        var settings = {
            dots: false,
            infinite: true,
            slidesToShow: 1,
            slidesToScroll: 1,
            adaptiveHeight: true,
        };
        return (
            <Slider {...settings}>

                <div >
                    <video
                        id="mainVideo"
                        src="https://ernesto-perez.com/wp-content/uploads/2019/08/video.mp4"
                        autoPlay
                        loop
                        type="video/mp4">
                    </video>
                </div>
                <div>
                    <img src="assets/images/eram_02.jpg" />
                </div>
                <div>
                <div id="picture2" className="flexslider-hero-picture3"></div>
                </div>
                <div>
                <div id="picture3" className="flexslider-hero-picture4"></div>
                </div>
            </Slider>
        );
    }
}

export default HeroCarousel;
